import numpy as np
import pandas as pd
import matplotlib.pyplot as plt
import seaborn as sns
import warnings
warnings.filterwarnings("ignore")

df = pd.read_csv("/content/train.csv")

df.head()

df.tail()

df.shape

df.describe()

df.isnull()

df.info()

df.isnull().sum()

df.drop(["PassengerId","Name","Ticket","Embarked","Cabin"],axis = 1,inplace = True)
df.head()

plt.figure(figsize = (16,9))
sns.countplot(x = "Pclass",hue = "Survived",data = df)

plt.figure(figsize = (16,9))
sns.countplot(x = "Sex",hue = "Survived",data = df)

plt.figure(figsize = (16,9))
sns.countplot(x = "Age",hue = "Survived",data = df)

plt.figure(figsize = (16,9))
sns.countplot(x = "SibSp",hue = "Survived",data = df)

plt.figure(figsize = (16,9))
sns.countplot(x = "Parch",hue = "Survived",data = df)

sns.boxplot(x = "Age",y = "Sex",data = df)

plt.figure(figsize = (16,9))
sns.histplot(df["Age"],color = "red")

plt.figure(figsize = (16,9))
sns.histplot(df["Parch"],color = "green",bins = 5)

plt.figure(figsize = (16,9))
sns.histplot(df["Fare"],color = "b",bins = 5)

plt.figure(figsize = (16,9))
sns.histplot(df["SibSp"],color = "y",bins = 5)

